Add Two Sum
这道题也是比较简单的，主要考察的就是链表的遍历。假设链表l1和l2的长度分别是m和n，则时间复杂度为o(m)+o(n)，注意其中第一个node不能要，所以return为l.Next，注意操作，并没有什么难度的。
思路
package solution

type ListNode struct {
    Val  int
    Next *ListNode
}

// add two num, eg: (2 -> 4 -> 3) + (5 -> 6 -> 4) -> (7 -> 0 -> 8)
func addTwoNumbers(l1 *ListNode, l2 *ListNode) *ListNode {

    // listNode for return
    l := &ListNode{}

    // to maintain the loop
    vL1, vL2, vL := l1, l2, l
    carry := 0
    for vL1 != nil || vL2 != nil {
        a, b, sum := 0, 0, 0
        if vL1 != nil {
            a = vL1.Val
            vL1 = vL1.Next
        }
        if vL2 != nil {
            b = vL2.Val
            vL2 = vL2.Next
        }
        sum = a + b +carry

        vL.Next = &ListNode{
            Val: sum % 10,
        }
        vL = vL.Next

        // update flag for next time
        carry = sum / 10
    }

    // check the last num
    if carry > 0 {
        vL.Next = &ListNode{
            Val: carry,
        }
    }
    return l.Next
}

